import GetUsers from "./getUsers";

export function VerifyIfExistUser (username: string, password: string) {
  GetUsers().then(users => {
    users.forEach((user: any) => {
      console.log(`
        usernamedb: ${user.nome}
        passworddb: ${user.senha}

        username: ${username}
        password: ${password}
      `)
    })
  }).catch(error => {
    console.error(error)
  })
}
